	function cycleThroughCoords() {
		try {
			dot.setAttribute('x', coordinatesList[currentCoordsIndex].x);
			dot.setAttribute('y', coordinatesList[currentCoordsIndex].y);

			if (currentCoordsIndex < (coordinatesList.length - 1)) {
				currentCoordsIndex++;
			} else {
				currentCoordsIndex = 0;
			}

			setTimeout(() => {
				cycleThroughCoords();
			}, 1000);
		} catch(e) {
			console.log(e);
		}
	}

	// Get a list of cities from your database
	async function getCoordinates(source) {
		const coordinatesCol = collection(source, 'coordinates', 'dot1', 'locations');
		const coordinatesSnapshot = await getDocs(coordinatesCol);
		coordinatesList = coordinatesSnapshot.docs.map(doc => {
			return doc.data();
		});
		
		cycleThroughCoords();
	}

	function addRedDot() {
		svg = document.getElementById('svg4498');
		dotGroup = document.createElementNS("http://www.w3.org/2000/svg","g");
		dot = document.createElementNS("http://www.w3.org/2000/svg","rect");

		dot.setAttribute('id', 'dot1');
		dot.setAttribute('width', '10');
		dot.setAttribute('height', '10');
		dot.setAttribute('fill','red');
		dot.setAttribute('rx','30');
		dot.setAttribute('x', '-100');
		dot.setAttribute('y', '-100');

		dotGroup.appendChild(dot);
		svg.appendChild(dotGroup);
	}

	addRedDot();
	await getCoordinates(db);
  </script>
</body>
